import React from 'react';
import './CartItem.css'; // Make sure to create a CartItem.css file for styles
import defaultImage from '../../Img/DefaultAvatar.png';

const CartItem = ({ productName, price, imageUrl }) => {
    return (
        <div className="cart-item">
            {imageUrl ? (
                <img src={imageUrl} alt="product" className="product-image" />
            ) : (
                <img src={defaultImage} alt="default" className="product-image" />
            )}
            <div className="product-info">
                <a href="/" className="product-name">{productName}</a>
                <p className="product-price">{price}</p>
            </div>
        </div>
    );
};

export default CartItem;
